import React from 'react'

export default function Info({ info }) {

    return (
        <div>
            {info.map((i, index) => {
                return <div className="wrapper">
                    <h4 key={index}>{i.metadata.title}</h4>
                    {i.metadata.text}
                </div>
            }

            )}
        </div>
    )
}
